def CountNoOfWays(n: int, k: int) -> int:
    if n < 1 or k < 1:
        raise ValueError("Preconditions: n >= 1 and k >= 1")
    mod = 1000000007
    dp = [0] * (n + 1)
    dp[0] = 1  # There is 1 way to reach step 0 (do nothing)
    for i in range(1, n + 1):
        for j in range(1, min(k, i) + 1):
            dp[i] = (dp[i] + dp[i - j]) % mod
    return dp[n]
